import React from "react";
import Papa from "papaparse";
import { Navigate, useNavigate } from "react-router-dom";

export default function ImportCSV() {
  const navigate = useNavigate();
  const activeUserId =
    sessionStorage.getItem("activeUserId") !== null
      ? sessionStorage.getItem("activeUserId")
      : null;
  const handleFile = (event) => {
    Papa.parse(event.target.files[0], {
      complete: function (result) {
        const data = [];
        result.data.map((d) => {
          return data.push({
            name: d[0],
            email: d[1],
            number: d[2],
            avatar: d[3],
            contactId: d[4],
          });
        });
        data.shift();
        const contacts = JSON.parse(localStorage.getItem([activeUserId])) || [];
        data.map((d) => {
          return contacts.push(d);
        });
        localStorage.setItem([activeUserId], JSON.stringify(contacts));
        Navigate("/home/view");
      },
    });
  };
  return (
    <div className="App">
      <h1>Import</h1>
      <input
        type="file"
        name="file"
        accept=".csv"
        onChange={handleFile}
      ></input>
    </div>
  );
}
